import logo from './icons/logo.svg';
import planeIcon from './icons/plane.svg';
import linkIcon from './icons/link.svg';
import './App.css';

function Button({ icon, text, link }) {
  return (
    <a href={link} target="_blank" rel="noopener noreferrer" className="button-link">
      <button className="button">
        {icon && <img src={icon} alt="button icon" className="button-icon" />}
        {text}
      </button>
    </a>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <br />
        {/* Button to open LinkedIn */}
        <Button icon={linkIcon} text="LinkedIn" link="https://www.linkedin.com/in/your-profile" />
        {/* Button to open a PDF */}
        <Button icon={planeIcon} text="View CV" link="/path/to/your-cv.pdf" />
        <p>
          This is a simple React application with a custom button component.
        </p>
        <p>
          The button includes an image and some text.
        </p>
      </header>
    </div>
  );
}

export default App;
